    it('Search results should search all results in tree ', function() {
        angular.mock.inject(function(fisMegaMenuSearchService) {

            var filteredNav = fisMegaMenuSearchService.search('abcdef',nav4.main, true);

            // Search must return only one node - a leaf node
            expect(filteredNav).toBeDefined();
            expect(filteredNav.length).toBe(1);

            expect(filteredNav).toBeDefined();
            expect(filteredNav.length).toBe(1);
            expect(filteredNav[0].children[0].children.length).toBe(1);
            expect(filteredNav[0].children[0].children[0].children.length).toBe(1);
            expect(filteredNav[0].children[0].children[0].children[0].children.length).toBe(1);
            expect(filteredNav[0].children[0].children[0].children[0].children[0].label).toBe("abcdef");

            // This search should return 2 nodes - abcdef and abcde-2
            // abcdeg returns by default (itself also satisfying the criteria) as it has children that satisfy the search criteria
            var filteredNav = fisMegaMenuSearchService.search('abcde',nav4.main, true);

            expect(filteredNav).toBeDefined();
            expect(filteredNav.length).toBe(1);
            expect(filteredNav[0].children[0].children.length).toBe(1);
            expect(filteredNav[0].children[0].children[0].children.length).toBe(2);
            expect(filteredNav[0].children[0].children[0].children[0].children.length).toBe(1);

            expect(filteredNav[0].children[0].children[0].children[0].label).toBe("abcdeg");
            expect(filteredNav[0].children[0].children[0].children[0].children[0].label).toBe("abcdef");
            expect(filteredNav[0].children[0].children[0].children[1].label).toBe("abcde-2");

            // this should return one node - abcdeg - which has children that do not satisfy the search, but abcdeg does
            var filteredNav = fisMegaMenuSearchService.search('abcdeg',nav4.main, true);
            expect(filteredNav).toBeDefined();
            expect(filteredNav.length).toBe(1);
            expect(filteredNav[0].children[0].children.length).toBe(1);
            expect(filteredNav[0].children[0].children[0].children.length).toBe(1);
            expect(filteredNav[0].children[0].children[0].children[0].label).toBe("abcdeg");
        });
    });

